          text:
            '<p><sup>17</sup>On his arrival, Jesus found that Lazarus had already been in the tomb for four days.&nbsp;<sup>18</sup>Now Bethany&nbsp;was less than two miles&nbsp;from Jerusalem,&nbsp;<sup>19</sup>and many Jews had come to Martha and Mary to comfort them in the loss of their brother.&nbsp;<sup>20</sup>When Martha heard that Jesus was coming, she went out to meet him, but Mary stayed at home. <sup>21</sup>"Lord," Martha said to Jesus, "if you had been here, my brother would not have died.&nbsp;<sup>22</sup>But I know that even now God will give you whatever you ask." <sup>23</sup>Jesus said to her,&nbsp;"Your brother will rise again." <sup>24</sup>Martha answered, "I know he will rise again in the resurrection&nbsp;at the last day." <sup>25</sup>Jesus said to her,&nbsp;"I am&nbsp;the resurrection and the life.&nbsp;The one who believes&nbsp;in me will live, even though they die;&nbsp;<sup>26</sup>and whoever lives by believing&nbsp;in me will never die.&nbsp;Do you believe this?" <sup>27</sup>"Yes, Lord," she replied, "I believe that you are the Messiah,&nbsp;the Son of God,&nbsp;who is to come into the world." <sup>28</sup>After she had said this, she went back and called her sister Mary aside. "The Teacher&nbsp;is here," she said, "and is asking for you."&nbsp;<sup>29</sup>When Mary heard this, she got up quickly and went to him.&nbsp;<sup>30</sup>Now Jesus had not yet entered the village, but was still at the place where Martha had met him.&nbsp;<sup>31</sup>When the Jews who had been with Mary in the house, comforting her,&nbsp;noticed how quickly she got up and went out, they followed her, supposing she was going to the tomb to mourn there. <sup>32</sup>When Mary reached the place where Jesus was and saw him, she fell at his feet and said, "Lord, if you had been here, my brother would not have died." <sup>33</sup>When Jesus saw her weeping, and the Jews who had come along with her also weeping, he was deeply moved&nbsp;in spirit and troubled.&nbsp;<sup>34</sup>"Where have you laid him?"&nbsp;he asked. "Come and see, Lord," they replied. <sup>35</sup>Jesus wept. <sup>36</sup>Then the Jews said, "See how he loved him!" <sup>37</sup>But some of them said, "Could not he who opened the eyes of the blind man&nbsp;have kept this man from dying?" <sup>38</sup>Jesus, once more deeply moved,&nbsp;came to the tomb. It was a cave with a stone laid across the entrance.&nbsp;<sup>39</sup>"Take away the stone,"&nbsp;he said. "But, Lord," said Martha, the sister of the dead man, "by this time there is a bad odor, for he has been there four days." <sup>40</sup>Then Jesus said,&nbsp;"Did I not tell you that if you believe,&nbsp;you will see the glory of God?" <sup>41</sup>So they took away the stone. Then Jesus looked up&nbsp;and said,&nbsp;"Father,&nbsp;I thank you that you have heard me.&nbsp;<sup>42</sup>I knew that you always hear me, but I said this for the benefit of the people standing here,&nbsp;that they may believe that you sent me." <sup>43</sup>When he had said this, Jesus called in a loud voice,&nbsp;"Lazarus, come out!"&nbsp;<sup>44</sup>The dead man came out, his hands and feet wrapped with strips of linen,&nbsp;and a cloth around his face. Jesus said to them,&nbsp;"Take off the grave clothes and let him go."</p><p>- John 11:17-44 (NIV)</p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
