            '<p><sup>44</sup><span style="color: rgb(0, 0, 0);">The man who had died came out,&nbsp;his hands and feet bound with linen strips, and&nbsp;his face wrapped with a cloth. Jesus said to them,&nbsp;"Unbind him, and let him go."</span></p><p>- <span style="color: rgb(0, 0, 0);">John 11:44 (ESV)</span></p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
