            '<p><sup>19</sup>For I have known him, in order&nbsp;that he may command his children and his household after him, that they keep the way of the&nbsp;Lord, to do righteousness and justice, that the&nbsp;Lord&nbsp;may bring to Abraham what He has spoken to him.&nbsp;</p><p>- Genesis 18:19 (NKJV)</p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
          actionString: '',
