          text:
            '<h2><span style="color: rgb(0, 0, 0); background-color: transparent;">Pursuing God + Loving with His heart = Serving others into greatness</span></h2><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
