          actionType: 'button',
          text:
            '<h2><span style="background-color: transparent; color: rgb(0, 0, 0);">Everyone is better when we serve each other</span></h2><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
