          text:
            '<p><sup>36</sup><span style="color: rgb(0, 0, 0);">Benaiah son of Jehoiada answered the king, "Amen! May the&nbsp;Lord, the God of my lord the king, so declare it.&nbsp;</span><sup>37</sup><span style="color: rgb(0, 0, 0);">As the&nbsp;Lord&nbsp;was with my lord the king, so may he be with&nbsp;Solomon to make his throne even greater&nbsp;than the throne of my lord King David!"</span></p><p><span style="color: rgb(0, 0, 0); background-color: transparent;">- 1 Kings 1: 36-37 (NIV)</span></p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
