          text:
            '<p><em style="background-color: transparent; color: rgb(0, 0, 0);">"You don\'t have to have a college degree to serve. You don\'t have to know about Plato and Aristotle to serve. You don\'t have to know Einstein\'s theory of relativity to serve. You don\'t have to know the second theory of thermodynamics in physics to serve . . . You don\'t have to make your subject and your verb agree to serve . . . You only need a heart full of grace, a soul generated by love. And you can be that servant."</em></p><p><em style="background-color: transparent; color: rgb(0, 0, 0);">- Dr. Martin Luther King, Jr., The Drum Major Instinct&nbsp;</em></p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
