              text:
                'Long, long ago, before time began, there was a perfect relationship, full of joy and satisfaction and glory. This perfect union was between God the Father, the Son and the Holy Spirit. Yet, the Father chose to share His joy by bringing us into it! And although we sometimes wander, He gives us the opportunity to RECEIVE and REMAIN in His perfect love!',
