              text:
                'Jesus, quoting the prophet Isaiah, said that his house would be called a \u201chouse of prayer for all nations\u201d (Matt. 21:13). This statement resounds over two thousand years later as a resounding call to the heart of the Christian life: prayer. Without prayer, the pursuit of God falls flat. But with prayer, one truly begins the journey of becoming by pursuing him, reaching out boldly to the Father who hears and answers his children.',
