          type: 'attributedText',
          actionType: 'button',
          text:
            '<p><sup>12</sup>Moses said to the&nbsp;Lord, "It is true that you have told me to lead these people to that land, but you did not tell me whom you would send with me. You have said that you know me well and are pleased with me.&nbsp;<sup>13</sup>Now if you are, tell me your plans, so that I may serve you and continue to please you. Remember also that you have chosen this nation to be your own." <sup>14</sup>The&nbsp;Lord&nbsp;said, "I will go with you, and I will give you victory." <sup>15</sup>Moses replied, "If you do not go with us, don\'t make us leave this place.&nbsp;<sup>16</sup>How will anyone know that you are pleased with your people and with me if you do not go with us? Your presence with us will distinguish us from any other people on earth." <sup>17</sup>The&nbsp;Lord&nbsp;said to Moses, "I will do just as you have asked, because I know you very well and I am pleased with you."</p><p>- <span style="color: rgb(0, 0, 0); background-color: transparent;">Exodus 33:12-17 (GNT)</span></p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
