            '<p><sup>18</sup>And Jesus, walking by the sea of Galilee, saw two brethren, Simon called Peter, and Andrew his brother, casting a net into the sea: for they were fishers. <sup>19</sup>And he saith unto them,&nbsp;Follow me, and I will make you fishers of men. <sup>20</sup>And they straightway left their nets, and followed him. <sup>21</sup>And going on from thence, he saw other two brethren, James the son of Zebedee, and John his brother, in a ship with Zebedee their father, mending their nets; and he called them. <sup>22</sup>And they immediately left the ship and their father, and followed him.</p><p>- <span style="background-color: transparent;">Matthew 4:18-22 (NKJV)</span></p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
