            '<p><strong style="background-color: transparent; color: rgb(0, 0, 0);">Specific Works and Assignments:</strong></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">1. RELATIONSHIPS: YOUR CALL TO GOD AND PEOPLE</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">2. OCCUPATIONS: YOUR CALL TO WORK/SCHOOL&nbsp;</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">3. MINISTRY: YOUR CALL TO SERVE IN THE KINGDOM</span></p><p><span style="background-color: transparent; color: rgb(0, 0, 0);">4. RENEWAL: YOUR CALL TO GROW PERSONALLY</span></p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
