              text:
                "<p>4. Think about your home, your schedule, your vocational life. In what ways can you activate God's grace by establishing order in your life?</p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>",
              actionString: '',
              mediaObject: null,
              allowNotes: true,
