              text:
                'The Christmas season is a time to be reminded that God didn\u2019t send a prophet, a messenger, or a spokesperson to the earth for us, but He sent His one and only Son. And His Son\u2019s birth was not just an arbitrary event, but it brought Good News \u2013 Good News that continues to bless us. \n\nIn a world where Good News is seldom celebrated, it\u2019s important to remember that Christ came to save us from sin by providing peace with God, joy for our days, and favor on our lives.',
