              type: 'attributedText',
              actionType: 'button',
              text:
                '<p><span style="background-color: transparent;">6. How can you grow in receiving and living in the light of Christ this week?</span></p><style>* { font-family: Proxima Nova; } p, ul, li, ol { font-size: 16px; } em { font-style: italic; }</style>',
